import "./HeroStyles.css";

function Hero (props) {
    return(
        <>
         <div className={props.className}>
           <img alt="heroImg" src="https://images.unsplash.com/photo-1607037183811-2a54d746cd35?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"/>
         
          <div className="hero-text">
            <h1>{props.title}</h1>
            <p>{props.text}</p>
            <a href={props.url} className={props.buttonClass}>
              {props.buttonText}
            </a>
          </div>
         </div>
        </>
    )
}

export default Hero;
